import './WVideo.css' 
import promo1 from './promo1.mp4'

const WVideo = () => {
    return (
    <div className="MainVideo">
<video
    id="my-video"
    className="video-js"
    src={promo1}
    currentsrc={promo1}
    autoPlay={true}
    loop={true}
    controls={true}
    preload="auto"
    
    data-setup="{}"
  >
  
  </video>
    </div>
    );
}
 
export default WVideo;
